inputString=""
k=9
L=524
t=19
output=[]

for index in range(0,(len(inputString)-L)):
    sample = inputString[index:index + L]
    listDict = {}
    
    for index2 in range(0,len(sample) - k):
        if sample[index2:index2 + k] not in listDict:
            listDict[sample[index2:index2 + k]] = 0
        listDict[sample[index2:index2 + k]] += 1
    
    for list in listDict:
        if listDict[list] >= t:
            if list in output:
                break
            output.append(list)

outputString = ''
for value in output:
    outputString = outputString + value + ' '
print(outputString.rstrip())